          "\u0410\u043D\u0434\u0440\u0435\u0439 \u0410\u043D\u0430\u0442\u043E\u043B\u044C\u0435\u0432\u0438\u0447 \u0421\u0443\u043B\u0438\u043D \u0443\u0440\u043E\u0436\u0435\u043D\u0435\u0446 \u0433\u043E\u0440\u043E\u0434\u0430 \u041B\u0438\u043F\u0435\u0446\u043A\u0430. \u0421 \u0441\u0430\u043C\u043E\u0433\u043E \u0434\u0435\u0442\u0441\u0442\u0432\u0430, \u0431\u0443\u0434\u0443\u0447\u0438 \u0435\u0449\u0435 \u043C\u0430\u043B\u0435\u043D\u044C\u043A\u0438\u043C \u043C\u0430\u043B\u044C\u0447\u0438\u043A\u043E\u043C, \u0435\u0436\u0435\u0434\u043D\u0435\u0432\u043D\u043E \u0443\u0432\u043B\u0435\u0447\u0435\u043D\u043D\u043E \u043B\u0435\u043F\u0438\u043B \u0438\u0433\u0440\u0443\u0448\u043A\u0438 \u0438\u0437 \u043F\u043B\u0430\u0441\u0442\u0438\u043B\u0438\u043D\u0430, \u0441\u043E\u0437\u0434\u0430\u0432\u0430\u044F \u0432 \u0441\u0432\u043E\u0435\u0439 \u043A\u043E\u043C\u043D\u0430\u0442\u0435 \u0446\u0435\u043B\u044B\u0435 \u0432\u044B\u0441\u0442\u0430\u0432\u043A\u0438. \u0412\u0441\u043A\u043E\u0440\u0435 \u0438 \u0440\u043E\u0434\u0438\u0442\u0435\u043B\u044F\u043C, \u0438 \u0441\u0430\u043C\u043E\u043C\u0443 \u0410\u043D\u0434\u0440\u0435\u044E \u0441\u0442\u0430\u043B\u043E \u043F\u043E\u043D\u044F\u0442\u043D\u043E: \u0435\u0433\u043E \u043F\u0440\u0438\u0437\u0432\u0430\u043D\u0438\u0435-\u0431\u044B\u0442\u044C \u0441\u043A\u0443\u043B\u044C\u043F\u0442\u043E\u0440\u043E\u043C. \u041F\u043E\u0441\u043B\u0435 10-\u0433\u043E \u043A\u043B\u0430\u0441\u0441\u0430 \u043E\u043D \u043F\u043E\u0441\u0442\u0443\u043F\u0438\u043B \u0432 \u0421\u0430\u0440\u0430\u0442\u043E\u0432\u0441\u043A\u043E\u0435 \u0445\u0443\u0434\u043E\u0436\u0435\u0441\u0442\u0432\u0435\u043D\u043D\u043E\u0435 \u0443\u0447\u0438\u043B\u0438\u0449\u0435.",
          "\u041F\u043E\u0441\u043B\u0435 \u0432\u0442\u043E\u0440\u043E\u0433\u043E \u043A\u0443\u0440\u0441\u0430 \u0410\u043D\u0434\u0440\u0435\u044F \u0437\u0430\u0431\u0440\u0430\u043B\u0438 \u0432 \u0430\u0440\u043C\u0438\u044E. \u0421\u043B\u0443\u0436\u0438\u043B \u043E\u043D \u0432 \u041C\u043E\u0441\u043A\u043E\u0432\u0441\u043A\u043E\u0439 \u043F\u043E\u0436\u0430\u0440\u043D\u043E\u0439 \u0447\u0430\u0441\u0442\u0438 \u0438 \u043D\u0430\u0440\u0430\u0432\u043D\u0435 \u0441 \u043D\u0430\u0441\u0442\u043E\u044F\u0449\u0438\u043C\u0438 \u043F\u043E\u0436\u0430\u0440\u043D\u044B\u043C\u0438 \u0443\u0447\u0430\u0441\u0442\u0432\u043E\u0432\u0430\u043B \u0432 \u0442\u0443\u0448\u0435\u043D\u0438\u0438 \u043F\u043E\u0436\u0430\u0440\u043E\u0432. \u0422\u043E\u0433\u0434\u0430 \u0443 \u043D\u0435\u0433\u043E \u0432\u043F\u0435\u0440\u0432\u044B\u0435 \u043F\u043E\u044F\u0432\u0438\u043B\u0430\u0441\u044C \u0438\u0434\u0435\u044F \u0441\u043E\u0437\u0434\u0430\u0442\u044C \u043F\u0430\u043C\u044F\u0442\u043D\u0438\u043A \u043F\u043E\u0436\u0430\u0440\u043D\u044B\u043C, \u043A\u043E\u0442\u043E\u0440\u0443\u044E \u0441\u043F\u0443\u0441\u0442\u044F 30 \u043B\u0435\u0442 \u043E\u043D \u0432\u043E\u043F\u043B\u043E\u0442\u0438\u043B \u0432 \u0436\u0438\u0437\u043D\u044C. \u041A \u0441\u043B\u043E\u0432\u0443 \u0441\u043A\u0430\u0437\u0430\u0442\u044C, \u0442\u0430\u043B\u0430\u043D\u0442 \u044E\u043D\u043E\u0433\u043E \u0441\u043A\u0443\u043B\u044C\u043F\u0442\u043E\u0440\u0430 \u0431\u044B\u043B \u043E\u0442\u043C\u0435\u0447\u0435\u043D \u0443\u0436\u0435 \u0432\u043E \u0432\u0440\u0435\u043C\u044F \u0441\u043B\u0443\u0436\u0431\u044B \u0432 \u0430\u0440\u043C\u0438\u0438.",
          "\u0417\u0430\u043A\u043E\u043D\u0447\u0438\u0432 \u0443\u0447\u0438\u043B\u0438\u0449\u0435, \u0410\u043D\u0434\u0440\u0435\u0439 \u0437\u0430\u043D\u044F\u043B\u0441\u044F \u043F\u0440\u043E\u0444\u0435\u0441\u0441\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u043E\u0439 \u0434\u0435\u044F\u0442\u0435\u043B\u044C\u043D\u043E\u0441\u0442\u044C\u044E \u0438 \u0432\u0441\u0442\u0443\u043F\u0438\u043B \u0432 \u0421\u043E\u044E\u0437 \u0445\u0443\u0434\u043E\u0436\u043D\u0438\u043A\u043E\u0432 \u0420\u043E\u0441\u0441\u0438\u0438. \u041E\u0434\u043D\u0430\u043A\u043E, \u043F\u0435\u0440\u0432\u043E\u0439 \u0441\u0432\u043E\u0435\u0439 \u0437\u043D\u0430\u0447\u0438\u043C\u043E\u0439 \u0440\u0430\u0431\u043E\u0442\u043E\u0439 \u0441\u043A\u0443\u043B\u044C\u043F\u0442\u043E\u0440 \u0441\u0447\u0438\u0442\u0430\u0435\u0442 \u043A\u043E\u043C\u043F\u043E\u0437\u0438\u0446\u0438\u044E, \u043A\u043E\u0442\u043E\u0440\u0430\u044F \u0432 2004 \u0433\u043E\u0434\u0443 \u0431\u044B\u043B\u0430 \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043B\u0435\u043D\u0430 \u043D\u0430 \u0446\u0435\u043D\u0442\u0440\u0430\u043B\u044C\u043D\u043E\u0439 \u0443\u043B\u0438\u0446\u0435 \u0432 \u0441. \u0421\u0442\u0430\u043D\u043E\u0432\u043E\u043C. \u041E\u043D\u0430 \u0438\u0437\u043E\u0431\u0440\u0430\u0436\u0430\u0435\u0442 \u0434\u0432\u0443\u0445 \u0441\u0430\u043C\u044B\u0445 \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u044B\u0445 \u0441\u0442\u0430\u043D\u043E\u0432\u043B\u044F\u043D\u0441\u043A\u0438\u0445 \u0441\u043F\u043E\u0440\u0442\u0441\u043C\u0435\u043D\u043E\u0432 - \u0433\u0438\u0440\u0435\u0432\u0438\u043A\u043E\u0432 \u0432 \u043C\u043E\u043C\u0435\u043D\u0442 \u0441\u043E\u0440\u0435\u0432\u043D\u043E\u0432\u0430\u043D\u0438\u0439: \u0448\u0435\u0441\u0442\u0438\u0434\u0435\u0441\u044F\u0442\u0438\u043B\u0435\u0442\u043D\u0435\u0433\u043E \u0410\u043B\u0435\u043A\u0441\u0435\u044F \u0412\u043E\u0440\u043E\u0442\u044B\u043D\u0446\u0435\u0432\u0430 \u0438 \u0435\u0433\u043E \u0443\u0447\u0435\u043D\u0438\u043A\u0430 \u041C\u0438\u0445\u0430\u0438\u043B\u0430 \u0420\u043E\u0434\u0438\u043E\u043D\u043E\u0432\u0430. "
