          "\u041E\u0431\u0430 \u043E\u043D\u0438 - \u043C\u043D\u043E\u0433\u043E\u043A\u0440\u0430\u0442\u043D\u044B\u0435 \u0447\u0435\u043C\u043F\u0438\u043E\u043D\u044B \u043C\u0438\u0440\u0430, \u0421\u0421\u0421\u0420 \u0438 \u0420\u043E\u0441\u0441\u0438\u0438 \u043F\u043E \u0433\u0438\u0440\u0435\u0432\u043E\u043C\u0443 \u0441\u043F\u043E\u0440\u0442\u0443. \u0420\u043E\u0434\u0438\u043E\u043D\u043E\u0432 \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u0438\u043B \u043D\u0435\u0441\u043A\u043E\u043B\u044C\u043A\u043E \u043C\u0438\u0440\u043E\u0432\u044B\u0445 \u0440\u0435\u043A\u043E\u0440\u0434\u043E\u0432. \u0412\u044B\u0441\u043E\u0442\u0430 \u043F\u0440\u0438\u0436\u0438\u0437\u043D\u0435\u043D\u043D\u043E\u0433\u043E \u043F\u0430\u043C\u044F\u0442\u043D\u0438\u043A\u0430 - \u043F\u043E\u0447\u0442\u0438 4 \u043C\u0435\u0442\u0440\u0430. \u041E\u0442\u043B\u0438\u0442 \u043E\u043D \u043D\u0430 \u041D\u043E\u0432\u043E\u043B\u0438\u043F\u0435\u0446\u043A\u043E\u043C \u043A\u043E\u043C\u0431\u0438\u043D\u0430\u0442\u0435.",
          "\u0417\u0430\u0442\u0435\u043C \u0431\u044B\u043B\u043E \u043C\u043D\u043E\u0433\u043E \u0434\u0440\u0443\u0433\u0438\u0445 \u0440\u0430\u0431\u043E\u0442, \u0440\u0430\u0441\u043F\u043E\u043B\u043E\u0436\u0435\u043D\u043D\u044B\u0445 \u043A\u0430\u043A \u0432 \u041B\u0438\u043F\u0435\u0446\u043A\u043E\u0439 \u043E\u0431\u043B\u0430\u0441\u0442\u0438, \u0442\u0430\u043A \u0438 \u0437\u0430 \u0435\u0435 \u043F\u0440\u0435\u0434\u0435\u043B\u0430\u043C\u0438. \u041D\u0430\u043F\u0440\u0438\u043C\u0435\u0440, \u043F\u0430\u043C\u044F\u0442\u043D\u0438\u043A \u043E\u0441\u043D\u043E\u0432\u0430\u0442\u0435\u043B\u044F\u043C \u0433\u043E\u0440\u043E\u0434\u0430 \u0427\u0430\u043F\u043B\u044B\u0433\u0438\u043D\u0430 \u0438\u043C\u043F\u0435\u0440\u0430\u0442\u043E\u0440\u0443 \u041F\u0435\u0442\u0440\u0443 I \u0438 \u0410. \u0414. \u041C\u0435\u043D\u0448\u0438\u043A\u043E\u0432\u0443, \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043B\u0435\u043D\u043D\u044B\u0439 \u0432 2013 \u0433\u043E\u0434\u0443 \u0432 \u0447\u0435\u0441\u0442\u044C 375-\u043B\u0435\u0442\u0438\u044F \u043E\u0441\u043D\u043E\u0432\u0430\u043D\u0438\u044F \u0433\u043E\u0440\u043E\u0434\u0430 \u0432 \u0433\u043E\u0440\u043E\u0434\u0441\u043A\u043E\u043C \u043F\u0430\u0440\u043A\u0435 \u0440\u044F\u0434\u043E\u043C \u0441 \u0412\u043E\u0437\u043D\u0435\u0441\u0435\u043D\u0441\u043A\u0438\u043C \u0441\u043E\u0431\u043E\u0440\u043E\u043C. \u041F\u0430\u043C\u044F\u0442\u043D\u0438\u043A \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u0442 \u0441\u043E\u0431\u043E\u0439 7-\u043C\u0435\u0442\u0440\u043E\u0432\u0443\u044E \u043A\u043E\u043C\u043F\u043E\u0437\u0438\u0446\u0438\u044E: \u043D\u0430 \u0442\u0440\u0435\u0445\u043C\u0435\u0442\u0440\u043E\u0432\u044B\u0439 \u043F\u043E\u0441\u0442\u0430\u043C\u0435\u043D\u0442 \u0432\u043E\u0434\u0440\u0443\u0436\u0435\u043D\u044B \u043A\u043E\u043D\u043D\u044B\u0435 \u0444\u0438\u0433\u0443\u0440\u044B \u0438\u043C\u043F\u0435\u0440\u0430\u0442\u043E\u0440\u0430 \u0438 \u0441\u0438\u044F\u0442\u0435\u043B\u044C\u043D\u043E\u0433\u043E \u043A\u043D\u044F\u0437\u044F. \u0410 \u0442\u0430\u043A\u0436\u0435, \u043F\u0430\u043C\u044F\u0442\u043D\u0438\u043A, \u043F\u043E\u0441\u0432\u044F\u0449\u0435\u043D\u043D\u044B\u0439 \u044D\u043A\u0438\u043F\u0430\u0436\u0443 \u0442\u0430\u043D\u043A\u0430 \u0422-34, \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043B\u0435\u043D\u043D\u044B\u0439 \u0432 \u041C\u043E\u0433\u0438\u043B\u0435\u0432\u0441\u043A\u043E\u043C \u0441\u043A\u0432\u0435\u0440\u0435 \u0422\u0443\u043B\u044B. \u041C\u043E\u043D\u0443\u043C\u0435\u043D\u0442, \u0432\u044B\u043F\u043E\u043B\u043D\u0435\u043D \u0432 \u0432\u0438\u0434\u0435 \u0447\u0435\u0442\u044B\u0440\u0435\u0445 \u0440\u043E\u0441\u0442\u043E\u0432\u044B\u0445 \u0444\u0438\u0433\u0443\u0440 \u0442\u0430\u043D\u043A\u043E\u0432\u043E\u0433\u043E \u044D\u043A\u0438\u043F\u0430\u0436\u0430 \u0441 \u043D\u0430\u0434\u043F\u0438\u0441\u044C\u044E \u043D\u0430 \u043E\u0441\u043D\u043E\u0432\u0430\u043D\u0438\u0438: \xAB\u042D\u043A\u0438\u043F\u0430\u0436\u0443 \u0442\u0430\u043D\u043A\u0430 \u0422-34\xBB. \u0412 \u043F\u043E\u0441\u0442\u0430\u043C\u0435\u043D\u0442\u0435 \u0441\u043A\u0443\u043B\u044C\u043F\u0442\u0443\u0440\u043D\u043E\u0439 \u043A\u043E\u043C\u043F\u043E\u0437\u0438\u0446\u0438\u0438 \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043D\u044B \u043F\u043E\u0434\u043B\u0438\u043D\u043D\u044B\u0435 \u0444\u0440\u0430\u0433\u043C\u0435\u043D\u0442\u044B \u0431\u0440\u043E\u043D\u0438 \u0438 \u0445\u043E\u0434\u043E\u0432\u043E\u0439 \u0447\u0430\u0441\u0442\u0438 \u0442\u0430\u043D\u043A\u0430 \u0422-34, \u043F\u043E\u0434\u043D\u044F\u0442\u044B\u0435 \u0432 \u0438\u044E\u043D\u0435 2019 \u0433\u043E\u0434\u0430 \u0432 \u0445\u043E\u0434\u0435 \u0432\u043E\u0435\u043D\u043D\u043E-\u043F\u0430\u0442\u0440\u0438\u043E\u0442\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u0430\u043A\u0446\u0438\u0438 \xAB\u0413\u0430\u0437\u043F\u0440\u043E\u043C \u0442\u0440\u0430\u043D\u0441\u0433\u0430\u0437 \u041C\u043E\u0441\u043A\u0432\u0430\xBB \xAB\u0412\u0430\u0445\u0442\u0430 \u043F\u0430\u043C\u044F\u0442\u0438\xBB \u0432 \u041F\u043E\u043D\u044B\u0440\u043E\u0432\u0441\u043A\u043E\u043C \u0440\u0430\u0439\u043E\u043D\u0435 \u041A\u0443\u0440\u0441\u043A\u043E\u0439 \u043E\u0431\u043B\u0430\u0441\u0442\u0438."
